import React from 'react';
import { useNavigate } from 'react-router-dom';
import { Ticket, Calendar, MapPin } from 'lucide-react';

const MyEvents = ({ theme, events, onCancel, t }) => {
  const navigate = useNavigate();
  const isDark = theme === 'dark';

  const styles = {
    container: {
      padding: '24px',
      backgroundColor: isDark ? '#0f172a' : '#fff',
      minHeight: '100vh', 
      fontFamily: 'sans-serif',
      display: 'flex',
      flexDirection: 'column',
      // --- ADDED THESE LINES TO FIX SIZE ---
      maxWidth: '430px', 
      margin: '0 auto',
      boxSizing: 'border-box'
    },
    headerTitle: {
      fontSize: '24px',
      fontWeight: 'bold',
      color: isDark ? '#fff' : '#0f172a',
      marginBottom: '30px',
      marginTop: '10px'
    },
    // EMPTY STATE
    emptyStateContainer: {
      flex: 1,
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      justifyContent: 'center',
      marginTop: '40px',
      textAlign: 'center'
    },
    emptyIcon: {
      color: '#cbd5e1',
      marginBottom: '20px'
    },
    emptyText: {
      fontSize: '18px',
      color: '#94a3b8',
      marginBottom: '25px'
    },
    browseBtn: {
      backgroundColor: '#5c5cfc',
      color: '#fff',
      border: 'none',
      padding: '14px 32px',
      borderRadius: '12px',
      fontSize: '16px',
      fontWeight: '600',
      cursor: 'pointer',
      boxShadow: '0 4px 12px rgba(92, 92, 252, 0.2)'
    },
    // TICKET LIST
    ticketList: {
      display: 'flex',
      flexDirection: 'column',
      gap: '16px',
      paddingBottom: '100px' // Space for bottom nav
    },
    ticketCard: {
      backgroundColor: isDark ? '#1e293b' : '#fff',
      borderRadius: '16px',
      border: isDark ? '1px solid #334155' : '1px solid #e2e8f0',
      padding: '16px',
      boxShadow: '0 4px 6px rgba(0,0,0,0.02)',
      position: 'relative',
      overflow: 'hidden'
    },
    statusBadge: (status) => ({
      position: 'absolute',
      top: '16px',
      right: '16px',
      fontSize: '12px',
      fontWeight: 'bold',
      padding: '4px 10px',
      borderRadius: '20px',
      backgroundColor: status === 'approved' ? '#dcfce7' : '#fef3c7',
      color: status === 'approved' ? '#16a34a' : '#d97706'
    }),
    eventTitle: {
      fontSize: '16px', // Slightly smaller for mobile fit
      fontWeight: 'bold',
      color: isDark ? '#fff' : '#1e293b',
      marginBottom: '10px',
      paddingRight: '70px',
      lineHeight: '1.4'
    },
    infoRow: {
      display: 'flex',
      alignItems: 'center',
      gap: '8px',
      fontSize: '13px',
      color: '#64748b',
      marginBottom: '6px'
    },
    actionRow: {
      marginTop: '16px',
      display: 'flex',
      gap: '10px'
    },
    viewBtn: {
      flex: 1,
      backgroundColor: '#f1f5f9',
      color: '#1e293b',
      border: 'none',
      padding: '10px',
      borderRadius: '8px',
      fontWeight: '600',
      fontSize: '13px',
      cursor: 'pointer'
    },
    cancelBtn: {
      flex: 1,
      backgroundColor: '#fff',
      color: '#ef4444',
      border: '1px solid #fee2e2',
      padding: '10px',
      borderRadius: '8px',
      fontWeight: '600',
      fontSize: '13px',
      cursor: 'pointer'
    }
  };

  return (
    <div style={styles.container}>
      <h2 style={styles.headerTitle}>My Tickets</h2>

      {events.length === 0 ? (
        <div style={styles.emptyStateContainer}>
          <Ticket size={80} strokeWidth={1.5} style={styles.emptyIcon} />
          <p style={styles.emptyText}>No tickets yet</p>
          <button style={styles.browseBtn} onClick={() => navigate('/events')}>
            Browse Events
          </button>
        </div>
      ) : (
        <div style={styles.ticketList}>
          {events.map(event => (
            <div key={event.id} style={styles.ticketCard}>
              <span style={styles.statusBadge(event.status)}>
                {event.status === 'approved' ? 'Confirmed' : 'Pending'}
              </span>
              
              <h3 style={styles.eventTitle}>{event.title}</h3>
              
              <div style={styles.infoRow}>
                <Calendar size={14} /> {event.date}
              </div>
              <div style={styles.infoRow}>
                <MapPin size={14} /> {event.location}
              </div>

              <div style={styles.actionRow}>
                {event.status === 'approved' && (
                  <button 
                    style={styles.viewBtn}
                    onClick={() => navigate(`/ticket-confirmation/${event.id}`)}
                  >
                    View Ticket
                  </button>
                )}
                <button 
                  style={styles.cancelBtn}
                  onClick={() => onCancel(event.id)}
                >
                  Cancel
                </button>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default MyEvents;
